import './ExpenseItem.css'
function ExpenseItem() {
  return (
    <div className='expense-item'>
      <div className='expense-item__description'>28th March,2022</div>
      <div className='expense-item__price'>Car Service
        <div>$250</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
